DROP TABLE IF EXISTS `_mask`;
CREATE TABLE `_mask` (
  `user` varchar(255) default NULL,
  `Scope` varchar(255) default NULL,
  `Method` varchar(255) default NULL,
  `onAssertPrivileges` longtext,
  `_comment` varchar(255) default NULL,
  `id` int(11) NOT NULL auto_increment,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `cache`;
CREATE TABLE `cache` (
  `identifier` varchar(512) default NULL,
  `value` varchar(8192) default NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `extensions`;
CREATE TABLE `extensions` (
  `id` varchar(25) NOT NULL default '',
  `name` varchar(150) default NULL,
  `version` varchar(4) default NULL,
  `loaded` tinyint(1) NOT NULL,
  `loadAtStartUp` tinyint(1) NOT NULL,
  `ghost` tinyint(1) NOT NULL default '0',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `grouplocaluser`;
CREATE TABLE `grouplocaluser` (
  `Name` varchar(32) NOT NULL default '',
  PRIMARY KEY  (`Name`),
  KEY `Name` (`Name`),
  KEY `Name_2` (`Name`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `log_action_descr`;
CREATE TABLE `log_action_descr` (
  `id` int(11) NOT NULL auto_increment,
  `description` varchar(255) default NULL,
  PRIMARY KEY  (`id`),
  KEY `idx_logactiondescr_description` (`description`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `log_actions`;
CREATE TABLE `log_actions` (
  `id` int(11) NOT NULL auto_increment,
  `parent_id` int(11) default NULL,
  `model_id` int(11) NOT NULL default '0',
  `user` varchar(255) default NULL,
  `date` datetime NOT NULL default '0000-00-00 00:00:00',
  `descr_id` int(11) NOT NULL default '0',
  `subject` varchar(255) default NULL,
  `details` longblob,
  PRIMARY KEY  (`id`),
  KEY `idx_logactions_modelid` (`model_id`),
  KEY `idx_logactions_parentid` (`parent_id`),
  KEY `idx_logactions_user` (`user`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `models`;
CREATE TABLE `models` (
  `modelID` int(11) NOT NULL auto_increment,
  `modelURI` varchar(255) default NULL,
  `baseURI` varchar(255) default NULL,
  PRIMARY KEY  (`modelID`),
  KEY `idx_models_modelURI` (`modelURI`)
) ENGINE=MyISAM AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `settings`;
CREATE TABLE `settings` (
  `key` varchar(255) character set latin1 NOT NULL,
  `value` varchar(255) default NULL,
  PRIMARY KEY  (`key`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `statements`;
CREATE TABLE `statements` (
  `modelID` int(11) NOT NULL default '0',
  `subject` varchar(255) default NULL,
  `predicate` varchar(255) default NULL,
  `object` longtext,
  `l_language` varchar(255) default NULL,
  `id` int(11) NOT NULL auto_increment,
  `author` varchar(255) default NULL,
  `stread` varchar(255) default NULL,
  `stedit` varchar(255) default NULL,
  `stdelete` varchar(255) default NULL,
  `epoch` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  PRIMARY KEY  (`id`),
  KEY `idx_statements_modelID` (`modelID`),
  KEY `idx_statements_subject` (`subject`),
  KEY `idx_statements_predicate` (`predicate`)
) ENGINE=MyISAM AUTO_INCREMENT=4337 DEFAULT CHARSET=utf8;

LOCK TABLES `statements` WRITE;
UNLOCK TABLES;


DROP TABLE IF EXISTS `subscribee`;
CREATE TABLE `subscribee` (
  `Login` varchar(32) default NULL,
  `Password` varchar(32) default NULL,
  `URL` varchar(255) default NULL,
  `Type` varchar(255) default NULL,
  `IdSub` int(32) NOT NULL auto_increment,
  `DatabaseName` varchar(128) default NULL,
  PRIMARY KEY  (`IdSub`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `subscriber`;
CREATE TABLE `subscriber` (
  `Id` int(32) NOT NULL auto_increment,
  `Login` varchar(32) default NULL,
  `Password` varchar(32) default NULL,
  `LastVisit` varchar(32) default NULL,
  `enabled` tinyint(1) NOT NULL default '0',
  `ismember` int(32) NOT NULL default '0',
  `DatabaseName` varchar(128) default NULL,
  PRIMARY KEY  (`Id`)
) ENGINE=MyISAM AUTO_INCREMENT=26 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `subscribersgroup`;
CREATE TABLE `subscribersgroup` (
  `ID` int(32) NOT NULL auto_increment,
  `subgroupof` int(32) NOT NULL default '0',
  `Name` varchar(32) default NULL,
  PRIMARY KEY  (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `login` varchar(32) NOT NULL default '',
  `password` varchar(32) default NULL,
  `admin` tinyint(1) NOT NULL default '0',
  `usergroup` varchar(32) default NULL,
  `LastName` varchar(64) default NULL,
  `FirstName` varchar(64) default NULL,
  `E_Mail` varchar(128) default NULL,
  `Company` varchar(128) default NULL,
  `Deflg` char(2) default NULL,
  `Uilg` varchar(2) default NULL,
  `enabled` tinyint(1) NOT NULL default '0',
  PRIMARY KEY  (`login`),
  KEY `login` (`login`),
  KEY `usergroup` (`usergroup`),
  KEY `login_2` (`login`),
  KEY `usergroup_2` (`usergroup`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


